import React from "react";
import logo from "../../assets/images/logo.png";

import { Container, Row, Button } from "reactstrap";
import { NavLink, Link } from "react-router-dom";

const nav_links = [
  {
    path: "/home",
    display: "Home",
  },

  {
    path: "#",
    display: "About",
  },

  {
    path: "/lab",
    display: "Labs",
  },
];
const Header = () => {
  return (
    <header className="header">
      <Container>
        <Row>
          <div className="nav_wrapper d-flex align-item-center justify-content-between">
            {/* ======logo===== */}
            <div className="logo">
              <img src={logo} alt="" />
            </div>
            {/* ========logo end======= */}
            {/* ========menu start======= */}
            <div className="navigation">
              <ul className="menu d-flex align-items-center gap-5">
                {nav_links.map((item, index) => (
                  <li className="nav__item" key={index}>
                    <NavLink to={item.path}>{item.display}</NavLink>
                  </li>
                ))}
              </ul>
            </div>
            {/* ========menu end======= */}
            <div className="nav__right d-flex align-item-center gap-4">
              <div className="nav__btns d-flex align-item-center gap-4">
                <Button className='btn secoundary__'>
                  <Link to="/login">Login</Link>
                </Button>
              </div>
            </div>
          </div>
        </Row>
      </Container>
    </header>
  );
};

export default Header;
